import './resultPage.css';

export default function ResultPage() {
    return (
        <div className='result'>
            <div>
                <a>
                    <div>
                        <p>Amir Fakhrullah Bin Omar</p>
                        <p>amir@imanshoppe.com</p>
                    </div>
                </a>
            </div>
        </div>
    )
}
